import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>DSHS ACT Hackathon</h1>
        <p>
          리액트 개발 환경이 성공적으로 설정되었습니다!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          React 공식 문서
        </a>
      </header>
    </div>
  );
}

export default App;
